import React, { Component } from 'react';
import './App.css';
import callOfDuty from './components/Games/callOfDuty.jpg';
import counterStrike from './components/Games/counterStrike.jpg';
import Fifa from './components/Games/fifa.jpg';
import marioKart from './components/Games/marioKart.jpeg';
import metalGearSolid from './components/Games/metalGearSolid.jpg';
import sniper from './components/Games/sniper.jpeg';


class App extends Component {
  render() {
    return (
      <div className="games">
        <img src={callOfDuty} alt="" className="game" />
        <img src={counterStrike} alt="" className="game" />
        <img src={fifa} alt="" className="game" />
        <img src={marioKart} alt="" className="game" />
        <img src={metalGearSolid} alt="" className="game" />
        <img src={sniper} alt="" className="game" />
      </div>
    )
  }

}

export default App;
